using System;\nusing System.Collections.Generic;\n\nclass Program\n{\n    static T GetLastElement<T>(List<T> list)\n    {\n        if (list == null || list.Count == 0)\n        {\n            throw new ArgumentException("List is empty or not initialized");\n        }\n        return list[list.Count - 1];\n    }\n\n    static void Main()\n    {\n        List<string> myList = new List<string> { "a", "b", "c" };\n        Console.WriteLine(GetLastElement(myList)); // Output: c\n    }\n}